import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the Profile navigation item to be visible
    await page.waitForSelector('.nav-item[data-view="profile"]');

    // Click on the Profile navigation item
    await page.click('.nav-item[data-view="profile"]');

    // Wait for the profile view to load
    await page.waitForSelector('.main-content');

    // Take a screenshot of the profile view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_view.png'));

    // Extract meaningful data (e.g., username)
    const username = await page.$eval('.username', el => el.textContent);
    const userHandle = await page.$eval('.user-handle', el => el.textContent);

    return {
      success: true,
      action: "Clicked on Profile navigation item to view current user's profile",
      extractedData: { username, userHandle },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

